import { Link } from "react-router-dom";

export const Navbar = () => {
  return (
    <div className="navbar">
      {/* <img src={requestAnimationFrame("../images/Pokemon-Logo-768x432.png")} /> */}
      <h1>Pokedex!</h1>
      <Link to="/">Home</Link>
      <Link to="/pokeInfo">Search Pokemon</Link>
    </div>
  );
};
